svg.script:
var panda, mazeLines, root;

function Init()
  {
    panda = document.getElementById('panda');
    mazeLines = document.getElementById('mazeLines');
    root = document.documentElement;
    setTimeout("advance()", 100);
}

var x = 0;
var y= 0;

function advance() {
    if ( ++x > 700 ) x = 0;
    if ( ++y > 400 ) y = 0;   

	// move panda
	panda.setAttribute("transform", "translate(" + (x*2) + ", " + (y*2) + ")");

	// collision detection
	if(root.getIntersectionList(mazeLines.getBBox(), null) != null) {
		alert('hit');
		mazeLines.setAttribute('style','fill:#FF0000');
	}

    setTimeout("advance()", 100);    
}
